import { createIcon } from "../icon/createIcon";

export const ShareSolidIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="ShareSolidIcon">
    <path d="M10 4a2 2 0 1 0 .001-3.999A2 2 0 0 0 10 4zm0 8a2 2 0 1 0 .001-3.999A2 2 0 0 0 10 12z" />
    <path d="M8.73 1.831 2.832 4.715l.439.898 5.898-2.884zm0 8.282L2.832 7.229l.439-.898 5.898 2.884z" />
    <path d="M2 8a2 2 0 1 0 .001-3.999A2 2 0 0 0 2 8z" />
  </svg>,
  "ShareSolid",
  "share solid"
);
